import React, { Component } from 'react';
import Navbar from '../navbar';
import Menu from '../menu';
import Chielduser from './chielduser';
import "./user.css"

class user extends Component {
    render() {
        return(
        <div>
        <Navbar />
        <Menu />
        <Chielduser />
        </div>
    ); 
    }
}

export default user;
